import React from "react";
import { pressButton } from "./app/action-creators/pressButton";
import { connect } from "react-redux";
import { bindActionCreators } from "redux";

class Button extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        console.log(state)
        return (
            <button key={this.props.value} onClick={() => this.props.pressButton(this.props.value)}>{this.props.value}</button>
        )
    }
}

function mapStateToProps(state) {
    return {
        firstVal: state.firstVal, 
        op: state.op, 
        secondVal: state.secondVal, 
        isFirst: state.isFirst
    }
}

function matchDispatchToProps(dispatch) {
    return bindActionCreators({pressButton: pressButton}, dispatch)
}

export default connect(mapStateToProps, matchDispatchToProps)(Button);
